      // define association here
      Location.hasMany(models.Complaint, {
        foreignKey:'locationId',
        onDelete:'CASCADE',
        onUpdate:'CASCADE',
      });
    }
  }
  Location.init({
    name: DataTypes.STRING,
    address: DataTypes.JSONB,
    latitude: DataTypes.DECIMAL,
    longitude: DataTypes.DECIMAL
  }, {
    sequelize,
    modelName: 'Location',
  });
  return Location;
};

